script: |
  super -f text -I q7605.spq | sort > q7605.out

inputs:
  - name: q7605.spq
    data: |
      SELECT col0 / + col1 + - tab0.col1 * col0 + - col2 * + tab0.col1 AS col2 FROM tab0 (FORMAT parquet) WHERE NOT ( - col2 + - col2 * col1 * col2 ) NOT IN ( tab0.col2 );
  - name: tab0

outputs:
  - name: q7605.out
    data: |
